(function(){if(!Element.prototype.matches){Element.prototype.matches=Element.prototype.matchesSelector||Element.prototype.webkitMatchesSelector||Element.prototype.mozMatchesSelector||Element.prototype.msMatchesSelector}if(!Element.prototype.closest){Element.prototype.closest=function(a){let node=this;while(node){if(node.matches(a)){return node}else{node=node.parentElement}}return null}}})();